import React from 'react';
import { Link } from 'react-router-dom';

function Footer(props) {
    return (
        <footer className="site-footer">
            <div className="container">
                <div className="row">             
                    <div className="col">
                        <p>Site Designed By: @GTheCodeGuy, 2021</p>
                    </div>  
                </div>
            </div>
        </footer>
    );
}

export default Footer;
